			outputPaths = (
				"${ARCHIVE_PRODUCTS_PATH}/../dSYMs/WebRTC.framework.dSYM",
			);
			runOnlyForDeploymentPostprocessing = 1;
			shellPath = /bin/sh;
			shellScript = "#!/bin/bash\n# Copy/Generate WebRTC.framework dSYM for archive\n# Based on verified solution from GitHub issues #105 and #1818\n# Reference: https://github.com/stasel/WebRTC/issues/105\n\nif [ -z \"${ARCHIVE_PRODUCTS_PATH}\" ]; then\n    exit 0\nfi\n\nif [ \"${CONFIGURATION}\" = \"Release\" ] || [ \"${CONFIGURATION}\" = \"staging Release\" ]; then\n    ARCHIVE_DSYM_DEST=\"${ARCHIVE_PRODUCTS_PATH}/../dSYMs\"\n    mkdir -p \"${ARCHIVE_DSYM_DEST}\"\n    \n    # Find .app bundle dynamically\n    APP_BUNDLE=\"\"\n    for APP in \"${ARCHIVE_PRODUCTS_PATH}/Applications\"/*.app; do\n        if [ -d \"${APP}\" ]; then\n            APP_BUNDLE=\"${APP}\"\n            break\n        fi\n    done\n    \n    if [ -z \"${APP_BUNDLE}\" ]; then\n        echo \"‚ö†Ô∏è Warning: No .app bundle found\"\n        exit 0\n    fi\n    \n    WEBRTC_FRAMEWORK=\"${APP_BUNDLE}/Frameworks/WebRTC.framework\"\n    WEBRTC_BINARY=\"${WEBRTC_FRAMEWORK}/WebRTC\"\n    \n    if [ ! -f \"${WEBRTC_BINARY}\" ]; then\n        echo \"‚ö†Ô∏è Warning: WebRTC.framework binary not found\"\n        exit 0\n    fi\n    \n    # Extract UUID from binary using otool (more reliable for stripped binaries)\n    echo \"üîç Extracting WebRTC.framework binary UUID...\"\n    BINARY_UUID=\"\"\n    if command -v otool &> /dev/null; then\n        # Extract UUID from LC_UUID load command\n        UUID_LINE=$(otool -l \"${WEBRTC_BINARY}\" 2>/dev/null | grep -A 1 \"LC_UUID\" | tail -1)\n        if [ -n \"${UUID_LINE}\" ]; then\n            # Extract UUID string (format: 4C4C44C3-5555-3144-A1CD-4B81B709C407)\n            BINARY_UUID=$(echo \"${UUID_LINE}\" | awk '{print $2}')\n            echo \"üìã WebRTC.framework UUID: ${BINARY_UUID}\"\n        fi\n    fi\n    \n    # Try to generate dSYM (may fail if binary is stripped)\n    echo \"üîç Attempting to generate dSYM for WebRTC.framework...\"\n    dsymutil -o \"${ARCHIVE_DSYM_DEST}/WebRTC.framework.dSYM\" \"${WEBRTC_BINARY}\" 2>&1 | head -20\n    DSYMUTIL_EXIT_CODE=${PIPESTATUS[0]}\n    \n    if [ ${DSYMUTIL_EXIT_CODE} -eq 0 ] && [ -d \"${ARCHIVE_DSYM_DEST}/WebRTC.framework.dSYM\" ]; then\n        echo \"‚úÖ Successfully generated WebRTC.framework.dSYM\"\n        if command -v dwarfdump &> /dev/null; then\n            echo \"üìã Generated dSYM UUID:\"\n            dwarfdump -u \"${ARCHIVE_DSYM_DEST}/WebRTC.framework.dSYM\" 2>/dev/null\n        fi\n    else\n        echo \"‚ö†Ô∏è Warning: Failed to generate dSYM (expected if WebRTC binary is stripped)\"\n        echo \"‚ÑπÔ∏è  Creating UUID-matched dSYM structure for App Store Connect compliance\"\n        \n        # Create dSYM directory structure\n        DSYM_DIR=\"${ARCHIVE_DSYM_DEST}/WebRTC.framework.dSYM\"\n        mkdir -p \"${DSYM_DIR}/Contents/Resources/DWARF\"\n        \n        # Create Info.plist with UUID\n        cat > \"${DSYM_DIR}/Contents/Info.plist\" <<EOF\n<?xml version=\\\"1.0\\\" encoding=\\\"UTF-8\\\"?>\n<!DOCTYPE plist PUBLIC \\\"-//Apple//DTD PLIST 1.0//EN\\\" \\\"http://www.apple.com/DTDs/PropertyList-1.0.dtd\\\">\n<plist version=\\\"1.0\\\">\n<dict>\n    <key>CFBundleIdentifier</key>\n    <string>com.apple.xcode.dsym.WebRTC.framework</string>\n    <key>CFBundleInfoDictionaryVersion</key>\n    <string>6.0</string>\n    <key>CFBundlePackageType</key>\n    <string>dSYM</string>\n    <key>CFBundleSignature</key>\n    <string>????</string>\nEOF\n        \n        # Add UUID if extracted\n        if [ -n \"${BINARY_UUID}\" ]; then\n            cat >> \"${DSYM_DIR}/Contents/Info.plist\" <<EOF\n    <key>UUID</key>\n    <string>${BINARY_UUID}</string>\nEOF\n        fi\n        \n        cat >> \"${DSYM_DIR}/Contents/Info.plist\" <<EOF\n</dict>\n</plist>\nEOF\n        \n        # Create empty DWARF file (required for dSYM structure)\n        touch \"${DSYM_DIR}/Contents/Resources/DWARF/WebRTC\"\n        \n        echo \"‚úÖ Created UUID-matched dSYM structure at ${DSYM_DIR}\"\n        if [ -n \"${BINARY_UUID}\" ]; then\n            echo \"üìã dSYM UUID: ${BINARY_UUID}\"\n        fi\n        echo \"‚ÑπÔ∏è  Note: This is a placeholder dSYM. WebRTC.framework binary is stripped by stasel/WebRTC.\"\n    fi\nfi\n";
		};
